import React, { Component } from "react";
import { BrowserRouter as Route, Switch } from "react-router-dom";
import Landingpage from "./Landingpage";

export class Main extends Component {
  render() {
    return (
      <Switch>
        <Route exact path="/" component={Landingpage} />
      </Switch>
    );
  }
}

export default Main;
